import { AppBar,Toolbar,styled} from '@mui/material';

const Header =styled(AppBar)`
background:#000000;
`;



const Tabs = styled('p')`
    font-size:20px;
    margin-right

`





const NavBar = () =>{
    return (
        <Header>
            <Toolbar>
                <Tabs>GDSC project</Tabs>
                <Tabs>All Users</Tabs>
                <Tabs>Add Users</Tabs>

            </Toolbar>
        </Header>
    )
}

export default NavBar;
